import React from 'react';

const IndexIntro = () => {
    const styles = {
        brand: {
            fontSize: '75px'
        }
    }

    return (
        <div>
            <div style={styles.brand}>
                HeyThere
            </div>
            <br/>
            <div>
                If You Don't have Account Now? <br/>
                Join TODAY!

            </div>
        </div>

    );
};

export default IndexIntro;
